import React from 'react';
import s from './Sidebar.module.css';
import Sidebarfriends from "./Sidebarfriends/Sidebarfriends";
import {addThreeFriendsActionCreator} from "../../../redux/sidebarReducer";

const Sidebar = (props) => {
    let addFriends = () => {
        debugger
        props.dispatch(addThreeFriendsActionCreator())
    };
    let threefriends = props.state.map((d) => <Sidebarfriends name={d.name} ava={d.ava}/>)
    return (
        <div>
            <button onClick={addFriends}>FRIENDS</button>

            <div className={s.wrapper}>
                {threefriends}
            </div>
        </div>
    )
}

export default Sidebar;
